import React, { useEffect, useState } from 'react';
import Row from 'react-bootstrap/esm/Row';
import { courseData } from './CoursesData';
// import "../Courses/Course.css"
// import './AllCourses.css'
import Container from 'react-bootstrap/esm/Container';
import CourseDesign from './CourseDesign';
import CourseError from './CourseError';
import CourseDesc from './CourseDesc';


const Course = ({ course }) => {
    // const [course, setcourse] = useState(courseData.courses)
    // useEffect(() => {
    //     setcourse([...courseData.courses])
    // }, [])
    return (
        <div className='course-section'>
            <Container>
                <Row className=''>
                    {
                        course.length >= 1 ? (
                            course.map((course) => {
                                return <CourseDesign key={course.id} course={course} />;
                            })

                        ) : <CourseError />

                    }
                </Row>
            </Container>
        </div>
    )
}

export default Course
